Table Nested Content Test

    body { margin: 16px; font-family: Arial, sans-serif; }
    table { border-collapse: separate; border-spacing: 0; }
    th, td { padding: 8px 12px; border: 1px solid #666; background: #fff; }
    thead th { background: #f0f0f0; }
    caption { caption-side: top; font-weight: bold; margin-bottom: 8px; }

    .nested-table { margin: 0; font-size: 0.9em; }
    .nested-table th, .nested-table td { 
      padding: 4px 6px; 
      border: 1px solid #999; 
      background: #f9f9f9; 
    }

    ul, ol { margin: 0; padding-left: 20px; }
    .image-placeholder { 
      width: 60px; 
      height: 40px; 
      background: #ddd; 
      border: 1px solid #999; 
      display: inline-block; 
      text-align: center; 
      line-height: 40px; 
      font-size: 12px; 
    }




